import Navbar from "./Components/Navbar";
import React from "react";
import { Route,Routes } from "react-router";
import Home from "./Routes/Home";
import About from "./Routes/About";
import Contact from "./Routes/Contact";
import Enroll from "./Routes/Enroll";
import Login from "./Routes/Login";
import SideNavbar from "./Components/InnerComponents/SideNavbar";
import Profile from './Routes/AfterLogin/Profile';
import Notice from './Routes/AfterLogin/Notice';
import Result from './Routes/AfterLogin/Result';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <SideNavbar/>
      <Routes>
        <Route element={<Profile/>}  path='/profile' />
        <Route element={<Notice/>}  path="/notice"/>
        <Route element={<Result/>}  path="/result" />
      </Routes>

      <Routes>
        <Route element={<Home/>} exact path='/' />
        <Route element={<About/>}  exact path="/about" />
        <Route element={<Contact/>} exact path='/contact' />
        <Route element={<Enroll/>}  exact path='/enroll' />
        <Route element={<Login/>}  exact path='/login' />
      </Routes>
    </div>
  );
}

export default App;
